import React, {useRef, useEffect} from "react";
import Navbar from "../components/Navbar";
import "../components/styles/buttons.css";
import Map from "../components/Google-maps";
import Form from "../components/Form";
import Footer from "../components/Footer";
import { Helmet } from "react-helmet";
import {  TweenMax, Power3 } from 'gsap';
import './styles/contact.css'
function Contact() {
    let image = useRef(null); //investigar como funciona esto
    let title = useRef(null); //investigar como funciona esto

    useEffect(()=>{
        TweenMax.to(
            image,
            2,
            {
                opacity: 1,
                y:-30,
                ease: Power3.easeOut
            }
        )
        TweenMax.to(
            title,
            2,
            {
                opacity: 1,
                y:-30,
                ease: Power3.easeOut,
                delay: 0.2
            }
        )
    })
    return (
        <React.Fragment>
            <Helmet> 
                <title>Contacto</title>
            </Helmet>
            <Navbar></Navbar>
            <div ref={selector =>{title = selector}} className="animation1">
            <Form  ></Form>
            </div>
            <div  ref={selector =>{image = selector}} className="animation2">
            <Footer></Footer>
            </div>
        </React.Fragment>
    )
}


export default Contact;
